import InvestmentView from "./InvestmentView";
import React from "react";

const PRICING = [
  {
    type: "Elopment",
    price: "$1200",
    detail: "2 hours", 
    img: "./photos/salazar.jpg",
    qty: "400 High resolution photos"
  },
  {
    type: "Engagement",
    price: "$500",
    detail: "1 hour", 
    img: "./photos/toth.jpg",
    qty: "120 High resolution photos"
  },
  {
    type: "Branding",
    price: "$750",
    detail: "3 hours", 
    img: "./photos/kristine.jpg",
    qty: "350 High resolution photos"
  },
]


const Investment = () => {
  return (
    <InvestmentView detail={PRICING}/>
  );
};

export default Investment;
